import React from 'react';
import styles from './SelectionButtons.module.css';
import Button from '../Button/Button';

export default function SelectionButtons({ text }) {
    return (
      <>
     <div className={styles.buttons__container}>
       <Button text=''/>
       <Button />
     </div>
      </>
    );
  }
